import api from './api';

const attendanceService = {
    checkIn: async (memberId) => {
        try {
            const response = await api.post(`/attendance/checkin`, { memberId });
            return response.data;
        } catch (error) {
            throw error.response.data;
        }
    },

    checkOut: async (memberId) => {
        try {
            const response = await api.post(`/attendance/checkout`, { memberId });
            return response.data;
        } catch (error) {
            throw error.response.data;
        }
    },

    getAttendanceLog: async (memberId) => {
        try {
            const response = await api.get(`/attendance/log/${memberId}`);
            return response.data;
        } catch (error) {
            throw error.response.data;
        }
    }
};

export default attendanceService;
